import React, { useState } from "react";
import "./App.css";
import ReactMapGL from "react-map-gl";

function App() {
  const [viewPort, setViewPort] = useState({
    width: 400,
    height: 400,
    latitude: 37.7575,
    longitude: -122.4512,
    zoom: 8,
  });
  return (
    <div className="App">
      <ReactMapGL
        {...viewPort}
        map
        onViewportChange={(nextViewPort) => setViewPort(nextViewPort)}
      />
    </div>
  );
}

export default App;
